import './home.css';
import { Router, Switch, Route, Link } from 'react-router-dom';

function Home() {
  return (
      <div className='body'>
        <li>
            <Link to='/jogos'>Jogos de Medo</Link>
        </li>
        <li>
            <Link to='/curtas'>Curtas de Medo</Link>
        </li>
      </div>
  );
}

export default Home;
